import{_ as a,c as e,o,V as t}from"./appads.jk3shxlx.js";const f=JSON.parse('{"title":"FE 70-200mm F4 Macro G OSS II","description":"","frontmatter":{},"headers":[],"relativePath":"belongings/offloads/SONY-SEL70200G2.md","filePath":"belongings/offloads/SONY-SEL70200G2.md","lastUpdated":1731199849000}'),r={name:"belongings/offloads/SONY-SEL70200G2.md"},l=t('<h1 id="fe-70-200mm-f4-macro-g-oss-ii" tabindex="-1">FE 70-200mm F4 Macro G OSS II <a class="header-anchor" href="#fe-70-200mm-f4-macro-g-oss-ii" aria-label="Permalink to &quot;FE 70-200mm F4 Macro G OSS II&quot;">​</a></h1><h2 id="購入情報" tabindex="-1">購入情報 <a class="header-anchor" href="#購入情報" aria-label="Permalink to &quot;購入情報&quot;">​</a></h2><ul><li>購入リンク: <a href="https://amzn.to/42zVop7" target="_blank" rel="noreferrer">https://amzn.to/42zVop7</a></li><li>購入日: 2024年2月5日</li><li>購入場所: メルカリ</li><li>購入金額: ¥202,500</li></ul><h2 id="売却情報" tabindex="-1">売却情報 <a class="header-anchor" href="#売却情報" aria-label="Permalink to &quot;売却情報&quot;">​</a></h2><ul><li>売却日: 2024年9月18日</li><li>売却場所: メルカリ</li><li>売却金額: ¥199,980</li></ul><details class="details custom-block"><summary>メルカリ詳細</summary><p>SONY FE 70-200mm F4 Macro G OSS Ⅱ</p><p>ヨドバシカメラで2023年11月に購入しましたが、望遠を使う機会がないため出品いたします。</p><p>試し撮りで動画や写真を数回撮った程度で、外へは一回しか持ち出ししていません。 買ってすぐにNDフィルターを付けていたため、レンズの傷もありません。</p><p>持ち出した日以外は防湿庫保管のため保存状態も良好です。</p><p>ほぼ新古品状態のため、動作は問題なく目立つ傷や汚れはありません。</p><p>使用していたNDフィルターも付属しますので、届いた日から撮影に使用できます。</p><p>発送は元々ついていた箱をプチプチの梱包材で包んだうえ、その箱を更にダンボールに入れ緩衝材をかませて発送いたします。</p><p>5年間の延長保証も付いております。</p><p>NDフィルター付属(Amazon定価で9000円くらい) NEEWER 2 in 1 72mm 可変NDフィルター ND2–ND32&amp;CPL多機能フィルター</p></details><h2 id="購入理由" tabindex="-1">購入理由 <a class="header-anchor" href="#購入理由" aria-label="Permalink to &quot;購入理由&quot;">​</a></h2><p>SEL100400GMが重すぎて持ち出す気にならず、宝の持ち腐れになっていた。そんな2023年10月頃に昔所有してたSEL70200Gの後継機が出るということで買い替えを決断。</p><h2 id="お気に入りポイント" tabindex="-1">お気に入りポイント <a class="header-anchor" href="#お気に入りポイント" aria-label="Permalink to &quot;お気に入りポイント&quot;">​</a></h2><h3 id="軽い" tabindex="-1">軽い <a class="header-anchor" href="#軽い" aria-label="Permalink to &quot;軽い&quot;">​</a></h3><p>最大焦点距離が2倍も違うので比べるものでもないのだが、SEL100400GMが1,395g（三脚座除く）と超重量級であるのに対し、SEL70200G2は約794g（三脚座除く）とかなり軽量になっている。ちなみに前世代のSEL70200Gと比べても約46g軽量化されている。</p><h3 id="ハーフマクロ機能" tabindex="-1">ハーフマクロ機能 <a class="header-anchor" href="#ハーフマクロ機能" aria-label="Permalink to &quot;ハーフマクロ機能&quot;">​</a></h3><p>最短撮影距離が広角側で0.26m、ズーム側で0.42mとかなりの近接撮影が可能。今までマクロレンズを使ったことはないので、新しい撮影手法を色々試して遊んでいる。</p><h3 id="オートフォーカス性能" tabindex="-1">オートフォーカス性能 <a class="header-anchor" href="#オートフォーカス性能" aria-label="Permalink to &quot;オートフォーカス性能&quot;">​</a></h3><p>これはα7C IIの恩恵なのかもしれないが、動物撮影の際のオートフォーカス性能が良すぎて驚いた。α7C IIで認識対象を動物/鳥に設定し、いつもどおり撮影するとオートフォーカスがビタビタに張り付く。動画を撮影するときも動物の瞳（外れても頭部や全体のAFは維持）から外れることはなく、技術の進歩を感じることができた。（以前の構成はα7III+SEL100400GM）</p><h2 id="いまいちポイント" tabindex="-1">いまいちポイント <a class="header-anchor" href="#いまいちポイント" aria-label="Permalink to &quot;いまいちポイント&quot;">​</a></h2><h3 id="特になし" tabindex="-1">特になし <a class="header-anchor" href="#特になし" aria-label="Permalink to &quot;特になし&quot;">​</a></h3><p>今のところマイナスに感じる要素はない。200mmの焦点距離に限界を感じたらテレコンにも挑戦してみたいと思っている。</p><h2 id="売却理由" tabindex="-1">売却理由 <a class="header-anchor" href="#売却理由" aria-label="Permalink to &quot;売却理由&quot;">​</a></h2><p>ミラーレス関連を一括処分することを決めたから。</p>',20),i=[l];function h(s,n,d,c,m,p){return o(),e("div",null,i)}const S=a(r,[["render",h]]);export{f as __pageData,S as default};
